import TheHome from './components/TheHome';
import TheSignup from './components/TheLogin';
import TheLogin from './components/TheSignup';

const routes = [
    {
        path: '/',
        name: 'the-home',
        component: TheHome,
    },
    {
        path: '/the-signup',
        name: 'TheSignup',
        component: TheSignup,
    },
    {
        path: '/the-login',
        name: 'TheLogin',
        component: TheLogin,
    },
];

export default routes;
